#USAGE OF TEMPS:
	#$t0, $t1, $t2 colour
	#$t3: 
	#$t4: background
	#$t5: pixels under player
	#$t6: used to check collision
	#$t7: counter for jumps
	
j gameStart

main:
	li $a0, BASE_ADDRESS
	li $a1, START_POSITION
	jal drawBackground
	
	#INITIALIZE
		#variables:
			#$s0: prev position
			#$s1: curr position
			#s2:  player direction
			#s3:  platform location 1
			#s4: platform location 2
			#s5: platform location 3
			#s6: Refresh rate
			#s7: current powerup (0: none ie moving down, 1: normal jump, 2: spring, 3: jetpack)
			#t5: pixels under player
		li $s0, END
		li $s1, START_POSITION
		li $s2, 0 #0 indicates down, 1 indicates up
		
		li $v0, 42
		li $a0, 0
		li $a1, 50
		syscall
		li $t1, ROW_LEN
		mult $t1, $a0
		mflo $t1
		addi $s3, $t1, BASE_ADDRESS
		
		li $v0, 42
		li $a0, 0
		li $a1, 5
		syscall
		li $t1, ROW_LEN
		mult $t1, $a0
		mflo $t1
		addi $s4, $t1, PLAT_3
		
		li $v0, 42
		li $a0, 0
		li $a1, 20
		syscall
		li $t1, ROW_LEN
		mult $t1, $a0
		mflo $t1
		addi $s5, $t1, START_PLAT
		
		li $s6, 50
		li $s7, 0
		li $t5, START_POSITION
		addi $t5, $t5, 1804
		
	
	loop:	
		jal movement
		li $a0, 0xffff0000
		lw $t9, 0($a0)
		bne $t9, 1, clear		#if key is not pressed then move on
		jal keypress

		clear:
			move $a0, $s0		#set a0 to prev location
			jal clearPoodle		#clear prev location
		draw:
			move $t5, $s1		#set t5 to start of player location
			addi $t5, $t5, 1804	#set t5 to start of bottom of player location
			#jal checkCollision
			move $a0, $s1		#set a0 to new location
			jal drawPoodle		#draw at new location
			move $a0, $s3		#set a0 to platform location
			jal drawRedBlock	#draw platform
			move $a0, $s4
			jal drawBrownBlock
			move $a0, $s5
			jal drawCyanBlock
			li $s5, HOLE
			#move $a0, $s5
			jal drawHole
			move $s0, $s1		#set s0 to current location
				
		sleep:
			li $v0, 32
			move $a0, $s6
			syscall
		
		j loop
	

#FINISH PEACEFULLLY
end:
	li $v0, 10
	syscall

movement:
	beq $s2, 1, goUp
	beq $s2, 0, goDown
		
goDown:
	li	$t4, MAGENTA		#stores the background colour in t4
	lw	$t6, 0($t5)		#sets t6 to the colour of t5
	beq	$t6, $t4, gameOver	#checks if the bottom left is colliding
	lw	$t6, -1804($t5)
	beq	$t6, $t4, gameOver	#checks if the top left
	lw	$t6, -1764($t5)
	beq	$t6, $t4, gameOver	#checks if the top right
	lw	$t6, 40($t5)
	beq	$t6, $t4, gameOver	#checks if the bottom right
	li	$t3, END
	addi	$t3, $t3, -2048
	bgt	$s1, $t3, gameOver	# if $s1 is in the bottom row, game over
	li	$t4, BACKGROUND		#stores the background colour in t4
	addi	$t5, $t5, ROW_LEN	#sets t5 to the pixel underneath the player
	lw	$t6, 0($t5)		#sets t6 to the colour of t5
	bne	$t6, $t4, setUp		#checks if the pixel under does not equal background
	lw	$t6, 4($t5)
	bne	$t6, $t4, setUp
	lw	$t6, 8($t5)
	bne	$t6, $t4, setUp
	lw	$t6, 12($t5)
	bne	$t6, $t4, setUp
	lw	$t6, 16($t5)
	bne	$t6, $t4, setUp
	# go down
	key_s:
		# make sure player is not in bottom row
		
		addi	$s1, $s1, ROW_LEN					# else, move down
		addi	$s1, $s1, ROW_LEN					# else, move down
		b return
#.......................................
goUp:	
	li	$t4, MAGENTA		#stores the background colour in t4
	lw	$t6, 0($t5)		#sets t6 to the colour of t5
	beq	$t6, $t4, gameOver	#checks if the bottom left is colliding
	lw	$t6, -1804($t5)
	beq	$t6, $t4, gameOver	#checks if the top left
	lw	$t6, -1764($t5)
	beq	$t6, $t4, gameOver	#checks if the top right
	lw	$t6, 40($t5)
	beq	$t6, $t4, gameOver	#checks if the bottom right
	beq	$t7, 20, stopUp
	li	$t2, ROW_LEN
	addi	$t2, $t2, BASE_ADDRESS
	addi	$t7, $t7, 1

	key_w:
		# make sure player is not in top row
		blt	$s1, $t2, gameWin				# if $s1 is in the top row, don't go up
		addi	$s1, $s1, -ROW_LEN				# else, move up
		addi	$s1, $s1, -ROW_LEN				# else, move up
		b return
	stopUp:
		li $s2, 0
		jr $ra
#.......................................

setUp:
	beq $s7, 0, normalJump #if there is not powerup, jump normally
	
	normalJump:
		li $t7, 0	
		li $s2, 1	#set the jump to up
		li $s7, 1	#set the jump type to normal
		jr $ra



#.......................................
keypress:
	li	$t1, ROW_LEN
	li	$t2, ROW_LEN
	addi	$t2, $t2, BASE_ADDRESS

	lw	$t0, 4($a0)
	beq	$t0, 0x61, key_a						# ASCII code of 'a' is 0x61 or 97 in decimal
	beq	$t0, 0x64, key_d						# ASCII code of 'd' is 0x64
	beq	$t0, 0x70, key_p						# ASCII code of 'p' is 0x70
	beq	$t0, 0x71, key_q						# ASCII code of 'p' is 0x71
	jr $ra
	# go left
	key_a:
		# make sure player is not in left column
		div	$s1, $t1						# see if player position is divisible by the width
		mfhi	$t9							# $t9 = $s1 mod $t1 
		beq	$t9, $zero, return					# if it is in the left column, we can't go left
		addi	$s1, $s1, -4						# else, move left
		b return

	# go right
	key_d:
		# make sure player is not in right column
		div	$s1, $t1						# see if player position is divisible by the width
		mfhi	$t9							# $t9 = $s1 mod $t1 
		addi	$t1, $t1, -48						# need to check if the mod is the row size - 12*4 (width of plane-1)
		beq	$t9, $t1, return					# if it is in the far right column, we can't go right
		addi	$s1, $s1, 4						# else, move right
		b return


	key_p:
		# restart game
		la	$ra, main
		b return
	key_q:
		#end game
		j end

	return:
		jr	$ra							# jump to ra
#.....................................

gameStart:
	la $t3, GAME_START
	li $t0, BASE_ADDRESS
	addi $t2, $zero, 0
	addi $t1, $zero, 8192
	
	gameStartLoop:
		ble $t1, 0, done
		add $t5, $t2, $t3    # combine the two components of the address
    		lw $t4, 0($t5)       # get the value from the array cell
    		sw $t4, 0($t0)
    		addi $t2, $t2, 4
    		addi $t1, $t1, -1
    		addi $t0, $t0, 4 		  # next pixel
    		j gameStartLoop
  done:
  	li $a0, 0xffff0000
	lw $t9, 0($a0)
	beq $t9, 1, goMain		#if key is not pressed then move on
	
goMain:
	lw	$t0, 4($a0)
	beq	$t0, 0x68, main						# ASCII code of 'p' is 0x70
	j goMain

#.....................................	

gameOver:
	la $t3, GAME_OVER_SCREEN
	li $t0, BASE_ADDRESS
	addi $t2, $zero, 0
	addi $t1, $zero, 8192
	
	gameOverLoop:
		ble $t1, 0, stop
		add $t5, $t2, $t3    # combine the two components of the address
    		lw $t4, 0($t5)       # get the value from the array cell
    		sw $t4, 0($t0)
    		addi $t2, $t2, 4
    		addi $t1, $t1, -1
    		addi $t0, $t0, 4 		  # next pixel
    		j gameOverLoop
  stop:
  	li $a0, 0xffff0000
	lw $t9, 0($a0)
	beq $t9, 1, restart		#if key is not pressed then move on
	
restart:
	lw	$t0, 4($a0)
	beq	$t0, 0x70, key_p						# ASCII code of 'p' is 0x70
	j restart
	
#........................................
gameWin:
	la $t3, GAME_WIN
	li $t0, BASE_ADDRESS
	addi $t2, $zero, 0
	addi $t1, $zero, 8192
	
	gameWinLoop:
		ble $t1, 0, stop2
		add $t5, $t2, $t3    # combine the two components of the address
    		lw $t4, 0($t5)       # get the value from the array cell
    		sw $t4, 0($t0)
    		addi $t2, $t2, 4
    		addi $t1, $t1, -1
    		addi $t0, $t0, 4 		  # next pixel
    		j gameWinLoop
  stop2:
  	li $a0, 0xffff0000
	lw $t9, 0($a0)
	beq $t9, 1, winner		#if key is not pressed then move on
	
winner:
	lw	$t0, 4($a0)
	beq	$t0, 0x1b, end						# ASCII code of 'esc' is 0x1b
	j winner
